import React, { Component } from 'react';
import './gradeEntry.css';

class TableItemHead extends Component {
    render() {

        const cellStyle = {
            width: "120px",
            textAlign: "center"
        }


        return (
        <th style={cellStyle} scope="col">
            <small></small>
            
            {this.props.title}  ({this.props.points})</th>
        );
    }
}

export default TableItemHead;
